import React from "react";
import styled from "styled-components";
import { Container } from "../../components/layout/Container";

const imagine = () => {
  const images = [];
  return (
    <Container space gap>
      <Context>
        <Header>
          <h1>Imagine with Frank.</h1>
          <p>
            Look at the variety of products, and appreciate the diversity of
            custom options Frank offers. This gallery allows you to explore some
            of our most recent projects. Whether you are a building professional
            with a keen eye for detail, or homeowner looking for inspiration,
            imagine the possibilities with Frank.
          </p>
        </Header>
        <Images></Images>
      </Context>
    </Container>
  );
};

const Context = styled.div`
  display: grid;
`;

const Header = styled.div`
  display: grid;
  gap: ${({ theme }) => theme.gap};
`;

const Images = styled.div`
  display: grid;
`;

export default imagine;
